/**
 * Create field with a float value.
 */
public Field(String name, float value, FieldType type) {
  if (name == null) {
    throw new IllegalArgumentException("name cannot be null");
  }
  this.type = type;
  this.name = name;
  this.fieldsData = Float.valueOf(value);
}

